import React from 'react';

class ImageList extends React.Component {
    render() {
        let { filterResult} = this.props;

        let images = null;
        if (!!filterResult) {
            images = filterResult.map((image) => (
                <li key = {image}><img src={image.imageUrl}></img></li>
            ));
        }
        return (
            <div id = "filterResult">
                <ul>
                    {images}
                </ul>
            </div>
        );
    }
}

export { ImageList }
